"use client"

import { useState } from "react"
import type { Session } from "@/types/session"
import QueryPanel from "./query-panel"
import MessagingPanel from "./messaging-panel"
import AdminPanel from "./admin-panel"
import "./dashboard.css"
import { API_BASE_URL } from "@/config/api"

interface DashboardProps {
  session: Session
  onLogout: () => void
}

type ActiveTab = "query" | "messages" | "admin"

export default function Dashboard({ session, onLogout }: DashboardProps) {
  const [activeTab, setActiveTab] = useState<ActiveTab>("query")

  const handleLogout = async () => {
    try {
      await fetch(`${API_BASE_URL}/logout`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          username: session.username,
          password: session.password,
        }),
      })
    } catch (error) {
      console.error("Logout error:", error)
    } finally {
      onLogout()
    }
  }

  return (
    <div className="dashboard-layout">
      <header className="dashboard-header">
        <div className="header-brand">
           <img 
              src={"data:image/jpeg;base64,"}
              alt="ConversQL Logo" 
              className="header-logo" 
            />
          <h1>ConversQL</h1>
        </div>
        <nav className="dashboard-nav">
          <button className={`nav-button ${activeTab === "query" ? "active" : ""}`} onClick={() => setActiveTab("query")}>
            Query
          </button>
          <button
            className={`nav-button ${activeTab === "messages" ? "active" : ""}`}
            onClick={() => setActiveTab("messages")}
          >
            Messages
          </button>
          {session.role === "admin" && (
            <button
              className={`nav-button ${activeTab === "admin" ? "active" : ""}`}
              onClick={() => setActiveTab("admin")}
            >
              Admin
            </button>
          )}
        </nav>
        <div className="header-right">
          <div className="user-info">
            Welcome, <strong>{session.username}</strong> ({session.role})
          </div>
          <button onClick={handleLogout} className="logout-button">
            Logout
          </button>
        </div>
      </header>

      <main className="dashboard-content">
        {activeTab === "query" && <QueryPanel session={session} />}
        {activeTab === "messages" && <MessagingPanel session={session} />}
        {activeTab === "admin" && session.role === "admin" && <AdminPanel session={session} />}
      </main>
    </div>
  )
}